/* Global variables */
volatile int pixel_buffer_start;
int byte1, byte2, byte3;
int p1_curX = MIN_X;
int p1_curY = MIN_Y;
int p2_curX = MAX_X;
int p2_curY = MAX_Y;
int p1_dx;
int p1_dy;
int p2_dx;
int p2_dy;
int p1_score;
int p2_score;
char p1_score_string[3];
char p2_score_string[3];
int winner;
int splash_count = 0;

/* Global struct */
struct board
{
    int x;
    int y;
    int colour;
    bool splash;
};
struct board game_board[22][22];

int main(void)
{
    volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;

    // initialize screen and set buffer
    *(pixel_ctrl_ptr + 1) = 0xC8000000;
    wait_for_vsync(pixel_ctrl_ptr);
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();
    draw_start();
    draw_text(63, 25, "                    ");
    draw_text(63, 30, "                    ");
    draw_text(63, 35, "                    ");
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    draw_start();
    draw_text(63, 25, "                    ");
    draw_text(63, 30, "                    ");
    draw_text(63, 35, "                    ");

    // initial gameboard set-up
    int i, j;
    for (i = 0; i < 22; i++)
    {
        for (j = 0; j < 22; j++)
        {
            game_board[i][j].x = MIN_X + j * 10;
            game_board[i][j].y = MIN_Y + i * 10;
            game_board[i][j].colour = 0;
            game_board[i][j].splash = false;
        }
    }

    // random number generator set-up
    srand(time(NULL));

    // loop until enter is pressed to start the game
    while (1)
    {
        get_PS2_input();
        if (byte3 == 0x5A)
        {
            break;
        }
    }

    // draw initial in-game visuals
    draw_game_board();
    draw_tile(MIN_X, MIN_Y, blue_player);
    draw_tile(MAX_X, MAX_Y, red_player);
    wait_for_vsync(pixel_ctrl_ptr);
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    draw_game_board();
    draw_tile(MIN_X, MIN_Y, blue_player);
    draw_tile(MAX_X, MAX_Y, red_player);

    // create transition and show ready messages
    int count;
    for (count = 1500000; count >= 0; count--)
    {
        if (count == 1500000)
        {
            draw_text(65, 30, "Ready...");
            wait_for_vsync(pixel_ctrl_ptr);
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            draw_text(65, 30, "Ready...");
        }
        else if (count == 1000000)
        {
            draw_text(65, 30, "            ");
            draw_text(65, 30, " Set...");
            wait_for_vsync(pixel_ctrl_ptr);
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            draw_text(65, 30, "            ");
            draw_text(65, 30, " Set...");
        }
        else if (count == 500000)
        {
            draw_text(65, 30, "            ");
            draw_text(65, 30, "  Go!  ");
            wait_for_vsync(pixel_ctrl_ptr);
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            draw_text(65, 30, "            ");
            draw_text(65, 30, "  Go!  ");
        }
        else if (count == 0)
        {
            // clear ready messages
            draw_text(65, 30, "            ");
            wait_for_vsync(pixel_ctrl_ptr);
            pixel_buffer_start = *(pixel_ctrl_ptr + 1);
            draw_text(65, 30, "            ");
        }
    }

    // main game logic
    while (1)
    {
        // check player movements and update gameboard state
        make_move();

        // generate splash bombs in the game
        if (splash_count < 2 && (p1_score >= 100 || p2_score >= 100))
        {
            int x_loc = rand() % 22;
            int y_loc = rand() % 22;
            game_board[y_loc][x_loc].splash = true;
            splash_count++;
        }

        // draw all residues and current splash bombs on the gameboard
        int i, j;
        for (i = 0; i < 22; i++)
        {
            for (j = 0; j < 22; j++)
            {
                if (game_board[j][i].colour == 1)
                {
                    draw_tile(game_board[j][i].x, game_board[j][i].y, blue_residue);
                }
                else if (game_board[j][i].colour == 2)
                {
                    draw_tile(game_board[j][i].x, game_board[j][i].y, red_residue);
                }
                if (game_board[j][i].splash)
                {
                    draw_tile(game_board[j][i].x, game_board[j][i].y, splash_bomb);
                }
            }
        }

        // draw player avatar
        draw_tile(p1_curX, p1_curY, blue_player);
        draw_tile(p2_curX, p2_curY, red_player);

        // update score
        draw_text(63, 25, "                    ");
        draw_text(63, 30, "                    ");
        draw_text(63, 35, "                    ");
        draw_text(65, 25, "Scores");
        draw_text(65, 30, "Blue: ");
        itoa(p1_score, p1_score_string, 10);
        draw_text(71, 30, p1_score_string);
        draw_text(65, 35, "Red: ");
        itoa(p2_score, p2_score_string, 10);
        draw_text(71, 35, p2_score_string);

        // change buffer
        wait_for_vsync(pixel_ctrl_ptr);
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

        // check for win condition
        if (p1_score >= 250)
        {
            winner = 1;
            break;
        }
        else if (p2_score >= 250)
        {
            winner = 2;
            break;
        }
    }

    // end game, draw winner information
    draw_text(63, 25, "                    ");
    draw_text(63, 30, "                    ");
    draw_text(63, 35, "                    ");
    if (winner == 1)
    {
        draw_end_blue();
    }
    else if (winner == 2)
    {
        draw_end_red();
    }

    wait_for_vsync(pixel_ctrl_ptr);
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);

    draw_text(63, 25, "                    ");
    draw_text(63, 30, "                    ");
    draw_text(63, 35, "                    ");
    if (winner == 1)
    {
        draw_end_blue();
    }
    else if (winner == 2)
    {
        draw_end_red();
    }
}

/* Control function */
// Obtain key press information
void get_PS2_input()
{
    volatile int *PS2_ptr = (int *)PS2_BASE;
    int PS2_data, RVALID;
    PS2_data = *(PS2_ptr);
    RVALID = PS2_data & 0x8000;
    if (RVALID)
    {
        /* save the last three bytes of data */
        byte1 = byte2;
        byte2 = byte3;
        byte3 = PS2_data & 0xFF;
    }
}

/* Game logic function */
// directional logic for the players and update the
// gameboard and scores after new movements
void make_move()
{
    get_PS2_input();

    int struct_x1 = (p1_curX - MIN_X) / 10;
    int struct_y1 = (p1_curY - MIN_Y) / 10;
    int struct_x2 = (p2_curX - MIN_X) / 10;
    int struct_y2 = (p2_curY - MIN_Y) / 10;

    // delta movement logic for player 1, updated based on keyboard inputs
    if (byte3 == 0x1D && struct_y1 > 0)
    {
        p1_dy = -10;
        p1_dx = 0;
    }
    if (byte3 == 0x1C && struct_x1 > 0)
    {
        p1_dx = -10;
        p1_dy = 0;
    }
    if (byte3 == 0x23 && struct_x1 < 21)
    {
        p1_dx = 10;
        p1_dy = 0;
    }
    if (byte3 == 0x1B && struct_y1 < 21)
    {
        p1_dy = 10;
        p1_dx = 0;
    }

    // delta movement logic for player 2, updated based on keyboard inputs
    if (byte3 == 0x75 && struct_y2 > 0)
    {
        p2_dy = -10;
        p2_dx = 0;
    }
    if (byte3 == 0x6B && struct_x2 > 0)
    {
        p2_dx = -10;
        p2_dy = 0;
    }
    if (byte3 == 0x74 && struct_x2 < 21)
    {
        p2_dx = 10;
        p2_dy = 0;
    }
    if (byte3 == 0x72 && struct_y2 < 21)
    {
        p2_dy = 10;
        p2_dx = 0;
    }

    // checking bounds for player 1
    if (struct_x1 == 0 && p1_dx == -10)
    {
        p1_dx = 0;
    }
    else if (struct_x1 == 21 && p1_dx == 10)
    {
        p1_dx = 0;
    }
    if (struct_y1 == 0 && p1_dy == -10)
    {
        p1_dy = 0;
    }
    else if (struct_y1 == 21 && p1_dy == 10)
    {
        p1_dy = 0;
    }

    // checking bounds for player 2
    if (struct_x2 == 0 && p2_dx == -10)
    {
        p2_dx = 0;
    }
    else if (struct_x2 == 21 && p2_dx == 10)
    {
        p2_dx = 0;
    }
    if (struct_y2 == 0 && p2_dy == -10)
    {
        p2_dy = 0;
    }
    else if (struct_y2 == 21 && p2_dy == 10)
    {
        p2_dy = 0;
    }

    // create new residue that the players leave behind
    game_board[struct_y1][struct_x1].colour = 1;
    game_board[struct_y2][struct_x2].colour = 2;

    // logic for splash bombs, passing through one creates a
    // 9 by 9 residue splash of the respective player's colour
    if (game_board[struct_y1][struct_x1].colour == 1 && game_board[struct_y1][struct_x1].splash)
    {
        int i, j;
        for (i = -4; i <= 4; i++)
        {
            for (j = -4; j <= 4; j++)
            {
                // check to prevent drawing residues outside of the gameboard
                if ((struct_y1 + i) >= 0 && (struct_y1 + i) <= 21 && (struct_x1 + j) >= 0 && (struct_x1 + j) <= 21)
                {
                    game_board[struct_y1 + i][struct_x1 + j].colour = 1;
                }
            }
        }
        game_board[struct_y1][struct_x1].splash = false;
        splash_count--;
    }
    if (game_board[struct_y2][struct_x2].colour == 2 && game_board[struct_y2][struct_x2].splash)
    {
        int i, j;
        for (i = -4; i <= 4; i++)
        {
            for (j = -4; j <= 4; j++)
            {
                // check to prevent drawing residues outside of the gameboard
                if ((struct_y2 + i) >= 0 && (struct_y2 + i) <= 21 && (struct_x2 + j) >= 0 && (struct_x2 + j) <= 21)
                {
                    game_board[struct_y2 + i][struct_x2 + j].colour = 2;
                }
            }
        }
        game_board[struct_y2][struct_x2].splash = false;
        splash_count--;
    }

    // update player current locations
    p1_curX += p1_dx;
    p1_curY += p1_dy;
    p2_curX += p2_dx;
    p2_curY += p2_dy;

    // check current game scores based on the amount of
    // residues each player have left behind
    int i, j;
    p1_score = 0;
    p2_score = 0;
    for (i = 0; i < 22; i++)
    {
        for (j = 0; j < 22; j++)
        {
            if (game_board[j][i].colour == 1)
            {
                p1_score += 1;
            }
            else if (game_board[j][i].colour == 2)
            {
                p2_score += 1;
            }
        }
    }
}

