// draw any 10 by 10 image
void draw_tile(int x, int y, const int image[10][10])
{
    int i, j;
    for (i = 0; i < 10; i++)
    {
        for (j = 0; j < 10; j++)
        {
            // draw all pixels that are not transparent (-1 in value)
            if (image[i][j] != -1)
            {
                plot_pixel(j + x, i + y, image[i][j]);
            }
        }
    }
}

// draw text on screen
void draw_text(int x, int y, char *text_ptr)
{
    int offset = (y << 7) + x;
    while (*(text_ptr))
    {
        *((char *)FPGA_CHAR_BASE + offset) = *(text_ptr);
        ++text_ptr;
        ++offset;
    }
}

// set entire screen to black
void clear_screen()
{
    int x;
    int y;
    for (x = 0; x < RESOLUTION_X; x++)
    {
        for (y = 0; y < RESOLUTION_Y; y++)
        {
            plot_pixel(x, y, 0x0000);
        }
    }
}

// store colour value into pixel addresses
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

// wait for screen refresh
void wait_for_vsync(volatile int *pixel_ctrl_ptr)
{
    register int status;
    *pixel_ctrl_ptr = 1; // start the synchronization process

    status = *(pixel_ctrl_ptr + 3);
    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
}